// frontend/src/components/InteractionHistory.jsx
import React from 'react';
import './InteractionHistory.css';

const InteractionHistory = ({ events, onClear }) => {
  return (
    <div className="interaction-record card">
      <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
        <h2 className="card__title">Interaction History</h2>
        <button onClick={onClear} className="clear-btn">Clear History</button>
      </div>
      <div className="history-scroll">
        {events.length === 0 ? (
          <p className="muted">No records yet. Send a module to see the history.</p>
        ) : (
          <ul className="history">
            {events.map((event) => (
              <li key={event.id}>
                <div className="history__line">
                  {event.traffic_condition && (
                    <span className="pill">{event.traffic_condition}</span>
                  )}
                  {event.incident_detected && (
                    <span className="tag">incident</span>
                  )}
                  <span className="loc">{event.location || event.area || "-"}</span>
                </div>
                <div className="history__meta">
                  <span>{event.at}</span>
                  {typeof event.vehicle_speed !== "undefined" && (
                    <span>{event.vehicle_speed} km/h</span>
                  )}
                  {typeof event.available_spots !== "undefined" && (
                    <span>{event.available_spots} spots</span>
                  )}
                  {event.alert_type && <span>âš  {event.alert_type}</span>}
                  {event.safety_status && <span>ðŸ›¡ {event.safety_status}</span>}
                  <span className={event.message === "received" ? "ok" : ""}>
                    {event.message}
                  </span>
                </div>
              </li>
            ))}
          </ul>
        )}
      </div>
    </div>
  );
};

export default InteractionHistory;
